import './VideoInformation.scss'
import VideoUrls from "./VideoUrls/VideoUrls";
import VideoEmbedCode from "./VideoEmbedCode/VideoEmbedCode";
import Duration from "./Duration/Duration";
import ViewsLikesDisLikes from "./ViewsLikesDisLikes/ViewsLikesDisLikes";
import TextInputWithUploadBtn from "./TextInputWithUploadBtn/TextInputWithUploadBtn";
import { AppContext } from "../../../../context/AppContext";
import TextInput from "./TextInput/TextInput";

const VideoInformation = props => {
    const contextData = useContext(AppContext);
    const [ state, setState ] = useState({});

       if (contextData.editingPostData.format === 'video'){
           return (
               <div className='VideoInformation'>
                   {/*<IsInSlideShow />*/}
                   {/*<Quality {...props}/>*/}
                   <TextInputWithUploadBtn name='videoTrailerUrl' title='Video Url'  {...props}/>
                   {/*<VideoEmbedCode name='videoEmbedCode'  {...props}/>*/}
                   {/*<Duration  {...props}/>*/}
                   {/*<ViewsLikesDisLikes name={'views'} {...props}/>*/}
                   {/*<ViewsLikesDisLikes name={'likes'} {...props}/>*/}
                   {/*<ViewsLikesDisLikes name={'disLikes'} {...props}/>*/}
                   {/*<TextInputWithUploadBtn name='VideoTrailerUrl' title='Video Trailer Url' {...props}/>*/}
                   {/*<TextInputWithUploadBtn name='mainThumbnail' title='Main thumbnail' {...props}/>*/}
                   {/*<TextInput name='downloadLink' title='Download Link'  {...props} />*/}
               </div>
           );
       }else {
           return (
               <h3>This Post Type Does not Support this Feature </h3>
           )
       }

};
export default VideoInformation;
